import { MechanismEnum } from "../../mech_enum";
import { MechParams } from "../params";
import { RsaMgf } from "./mgf";
export class RsaOaepParams {
    constructor(hashAlg = MechanismEnum.SHA1, mgf = RsaMgf.MGF1_SHA1, sourceData = null) {
        this.source = 1;
        this.type = MechParams.RsaOAEP;
        this.hashAlgorithm = hashAlg;
        this.mgf = mgf;
        this.sourceData = sourceData;
    }
    toCKI() {
        return {
            hashAlg: this.hashAlgorithm,
            mgf: this.mgf,
            source: this.source,
            sourceData: this.sourceData,
            type: this.type,
        };
    }
}
